import Carousel from "./Components/Carousel";
import { Home } from "./Components/Home";
import {Route, Switch} from 'react-router-dom';
function App() {
  return (
    <div>
      <Switch>
        <Route path="/" component={Home}/>
      </Switch>
      <Home/>
    </div>
  );
}

export default App;
